import React from "react";
import Header from "../components/Header";
import { useNavigate } from "react-router-dom";


const  TagPage=() => {

    const navigation = useNavigation();

    return (
        <div>
            <Header/>
            <div>
                <button 
                    onClick={()=>navigation(-1)}
                />
            </div>
        </div>

    );
}

export default TagPage;
